<script>
var isHovering = false
var tso = new Audio('tsosas2_v2.mp3');
tso.play();
tso.volume = 0.2;

$(document).on('mousemove', function(e){
	var details = e.target

	if ($(details).attr('data-sctitle')){
        if (!isHovering) {
            var audio = new Audio('snd_mouseover.ogg');
            audio.play();
        }
        isHovering = true
        $('#popup').html($(details).attr('data-sctitle'))
		$('#popup').css({
		   left:  e.pageX + 1,
		   top:   e.pageY + 1,
			"display": "inherit"
		});
	} else {
        isHovering = false
		$('#popup').css({
			"display": "none"
		});
	}
});
</script>
